import React,{ Component } from 'react';
import {Nav,Navbar,Container} from 'react-bootstrap';
import styled from 'styled-components';
import {Link,NavLink} from 'react-router-dom';
import $ from 'jquery';




// export const Menu = () => (
   
// )











export class Menu extends Component {
  
  componentDidMount(){
    
    $('.js-scroll-trigger').click(function() {
      $('.navbar-collapse').removeClass('.collapse');
    });
  
  }
  render() {
    return (
      <nav className="navbar navbar-expand-lg custom_nav">
      <div className="container">
      {/* <a className="navbar-brand" href="#">SEO</a> */}
      <Link className="nav-link" to="/">SEO</Link>
      <button className="navbar-toggler " type="button" data-toggle="collapse" data-target="#mynav" aria-expanded="false" aria-controls="mynav">
  <span className="navbar-toggler-icon"><i className="fas fa-bars"></i></span>
  </button>
  
  <div className="collapse navbar-collapse" id="mynav">
  <ul className="navbar-nav ml-auto">
    <li className="nav-item">
      <Link className="nav-link js-scroll-trigger"  data-toggle="collapse" to="/">Home </Link>
    </li>
    <li className="nav-item">
      <Link className="nav-link js-scroll-trigger" to="/services">Services</Link>
    </li>
    <li className="nav-item">
      <Link className="nav-link js-scroll-trigger" to="/price">Pricing</Link>
    </li>
    <li className="nav-item">
      <Link className="nav-link js-scroll-trigger" to="/portfolio">Portfolio</Link>
    </li>
    <li className="nav-item">
    <NavLink className="nav-link js-scroll-trigger" to="/blog">Blog</NavLink>
    </li>
    <li className="nav-item">
      <Link className="nav-link js-scroll-trigger" to="/contact">Contact</Link>
    </li>
  
    
   
  </ul>
  
  </div>
      </div>
  </nav>
    )
  }
}
